import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <nav id="nav-container">
        <ul class="nav-links">
          <li><a href="">About Me</a></li>
          <li><a href="">Projects</a></li>
          <li><a href="">Contact</a></li>
        </ul>
      </nav>
    </div>
  );
}

export default App;
